import "../assets/sass/footer.sass";
import React, { useState, useEffect } from "react";
import { useQuery, gql } from '@apollo/client';
import { IFooterData } from "./blocks/types";
import SectionLink from "./SectionLink";

export default function Footer(): JSX.Element {

  const footerQuery = gql`
  query siteOption {
    option {
      footer {
        titleLeft
        logoFooter {
          node {
            altText
            link
            sourceUrl
            srcSet
          }
        }
        descriptionLeft
        email
        titleRight
        phone
        address {
          title
          target
          url
        }
        backgroundDesktop {
          node {
            altText
            link
            sourceUrl
            srcSet
          }
        }
        buttonContact {
          target
          title
          url
        }
        codeOfConduct {
          target
          title
          url
        }
        cookiesPolicy {
          target
          title
          url
        }
        privacyPolicy {
          target
          title
          url
        }
        backgroundMobile {
          node {
            altText
            link
            sourceUrl
            srcSet
          }
        }
        backgroundSection {
          node {
            altText
            link
            sourceUrl
            srcSet
          }
        }
        backgroundSectionMobile {
          node {
            altText
            link
            sourceUrl
            srcSet
          }
        }
        social {
          link {
            url
            title
            target
          }
          icon {
            node {
              sourceUrl
            }
          }
        }
      }
    }
  }
  `;

  const { loading, error, data } = useQuery(footerQuery);

  // State
  const [footerData, setFooterData] = useState<IFooterData>({
    titleLeft: "",
    logoFooter: {
      node: {
        altText: "",
        link: "",
        sourceUrl: "",
        srcSet: "",
      },
    },
    descriptionLeft: "",
    email: "",
    titleRight: "",
    phone: "",
    address: {
      title: "",
      target: "",
      url: "",
    },
    backgroundDesktop: {
      node: {
        altText: "",
        link: "",
        sourceUrl: "",
        srcSet: "",
      },
    },
    buttonContact: {
      target: "",
      title: "",
      url: "",
    },
    codeOfConduct: {
      target: "",
      title: "",
      url: "",
    },
    cookiesPolicy: {
      target: "",
      title: "",
      url: "",
    },
    privacyPolicy: {
      target: "",
      title: "",
      url: "",
    },
    backgroundMobile: {
      node: {
        altText: "",
        link: "",
        sourceUrl: "",
        srcSet: "",
      },
    },
    backgroundSection: {
      node: {
        altText: "",
        link: "",
        sourceUrl: "",
        srcSet: "",
      },
    },
    backgroundSectionMobile: {
      node: {
        altText: "",
        link: "",
        sourceUrl: "",
        srcSet: "",
      },
    },
    social: []
  });
  const [imageFooter, setImageFooter] = useState("");
  const [backgroundFooter, setBackgroundFooter] = useState("");
  // const [dataSocial, setDataSocial] = useState("");
  const handleOpenContactPopup = (e) => {
    e.preventDefault();
    document.body.classList.add("active-form");
    document.querySelector('.section-contact-popup')?.classList.add('show');
  }
  // useEffect
  useEffect(() => {
    if (!loading && !error && data && data.option.footer) {
      setFooterData(data.option.footer);

    }
    const handleResize = () => {
      const windowWidth = window.innerWidth;
      if (!loading && !error && data && data.option.footer) {
        if (windowWidth < 768) {
          setBackgroundFooter(data.option.footer.backgroundSectionMobile.node.sourceUrl);
          setImageFooter(data.option.footer.backgroundMobile.node.sourceUrl);
        } else {
          setBackgroundFooter(data.option.footer.backgroundSection.node.sourceUrl);
          setImageFooter(data.option.footer.backgroundDesktop.node.sourceUrl);
        }
      }
    };

    window.addEventListener("resize", handleResize);
    handleResize();
    // console.log(footerData.social);
    const dataSocial = Object.values(footerData.social);
    // setDataSocial(Object.values(footerData.social));
  }, [data]);

  // useEffect(() => {
  //   setDataSocial(Object.values(footerData.social));
  // }, [footerData]);

  const getSocialSVG = (url: string) => {
    if (url.includes('facebook.com')) {
      return `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 34 34.09" width="34" height="34"><path d="M1011.24,528.64v22.72a5.63,5.63,0,0,1-5.63,5.64h-5.05V543.52h5.23v-5.29h-5.24v-3.38c0-1.53.42-2.57,2.62-2.57h2.8v-4.94h-4.08c-4,0-6.8,2.46-6.8,7v3.9h-4.57v5.29h4.57V557H982.88a5.64,5.64,0,0,1-5.64-5.64V528.64a5.64,5.64,0,0,1,5.64-5.64h22.73A5.63,5.63,0,0,1,1011.24,528.64Z" transform="translate(-977.24 -523)" style="&#10;"/></svg>`;
    } else if (url.includes('instagram.com')) {
      return `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="34" height="34" viewBox="0 0 34 34" fill="none">
        <rect width="34" height="34" fill="url(#icon-instagram-pattern0)"></rect>
        <defs>
          <pattern id="icon-instagram-pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
            <use xlink:href="#icon-instagram-img0" transform="translate(-0.0005) scale(0.001)"></use>
          </pattern>
          <image id="icon-instagram-img0" width="1001" height="1000" xlink:href="data:image/png;base64,"></image>
        </defs>
      </svg>`;
    } else if (url.includes('linkedin.com')) {
      return `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="34" height="34" viewBox="0 0 34 34" fill="none">
      <rect width="34" height="34" fill="url(#icon-linkedin-pattern0)"></rect>
      <defs>
        <pattern id="icon-linkedin-pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
          <use xlink:href="#icon-linkedin-img0" transform="translate(-0.0005) scale(0.001)"></use>
        </pattern>
        <image id="icon-linkedin-img0" width="1001" height="1000" xlink:href="data:image/png;base64,"></image>
      </defs>
    </svg>`;
    } else if (url.includes('twitter.com')) {
      return `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="34" height="34" viewBox="0 0 34 34" fill="none">
      <rect width="34" height="34" fill="url(#icon-x-pattern-0)"></rect>
      <defs>
        <pattern id="icon-x-pattern-0" patternContentUnits="objectBoundingBox" width="1" height="1">
          <use xlink:href="#icon-x-img-0" transform="translate(-0.0005) scale(0.001)"></use>
        </pattern>
        <image id="icon-x-img-0" width="1001" height="1000" xlink:href="data:image/png;base64,"></image>
      </defs>
    </svg>`;
    } else {
      return ``;
    }
  }

  return (
    <footer className="site-footer" style={{ backgroundImage: "url(" + backgroundFooter + ")" }}>
      <div className="container">
        <div className="section-top">
          <div className="left">
            {(footerData.titleLeft && footerData.titleLeft !== "") && (
              <h5 className="title">{footerData.titleLeft}</h5>
            )}
            {(footerData.descriptionLeft && footerData.descriptionLeft !== "") && (
              <div className="content top">{footerData.descriptionLeft}</div>
            )}
            {(footerData.buttonContact && footerData.buttonContact.title) && (
              <a onClick={handleOpenContactPopup} href={footerData.buttonContact.url} target={footerData.buttonContact.target}><div className="button">{footerData.buttonContact.title}</div></a>
            )}
          </div>
          <div className="social-container mb">
            {(footerData.social) && (
              footerData.social.map((item: any, index: any) => (
                <a className="social-item" target={item.link.target} href={item.link.url} >
                  <div className="icon" dangerouslySetInnerHTML={{__html: getSocialSVG(item.link.url)}}></div>
                </a>
              ))
            )}
          </div>
          <div className="right">

            <div className="content-container content-left">
              {(footerData.email && footerData.email !== "") && (
                <a className="email content" href={`mailto:${footerData.email}`} target="_blank">{footerData.email}</a>
              )}
              {(footerData.phone && footerData.phone !== "") && (
                <a className="phone content" href={`tel:${footerData.phone}`} target="_blank">{footerData.phone}</a>
              )}
              {(footerData.titleRight && footerData.titleRight !== "") && (
                <h5 className="title right">{footerData.titleRight}</h5>
              )}
              {(footerData.address && footerData.address.title) && (
                <a className="address content top" target={footerData.address.target} href={footerData.address.url} >{footerData.address.title}</a>
              )}
            </div>
            <div className="ft-mb content-right">
              <div className="social-container dk">
                {(footerData.social) && (
                  footerData.social.map((item: any, index: any) => (
                    <a className="social-item" target={item.link.target} href={item.link.url} >
                      <div className="icon" dangerouslySetInnerHTML={{__html: getSocialSVG(item.link.url)}}></div>
                    </a>
                  ))
                )}
              </div>
              <SectionLink
                privacyPolicy={footerData.privacyPolicy}
                cookiesPolicy={footerData.cookiesPolicy}
                codeOfConduct={footerData.codeOfConduct}
              />
            </div>
          </div>
        </div>
        <div className="section-middle">
          <svg className="icon-ft" xmlns="http://www.w3.org/2000/svg" width="117" height="135" viewBox="0 0 117 135" fill="none">
            <path d="M0 0V13.4922H81.6952L0 60.6585V134.924H116.849V121.375H35.1536L116.849 74.2081V0H0Z" fill="#0068FF" />
          </svg>
          {imageFooter && (
            <div className="img-footer" style={{ backgroundImage: "url(" + imageFooter + ")" }}></div>
          )}
        </div>

      </div>
    </footer>
  );
};
